def longest_increasing_subsequence(nums):
    if not nums:
        return []
    n = len(nums)
    dp = [1] / n
    for i in range(n):
        for j in range(i):
            if nums[j] < nums[i]:
                dp[i] = max(dp[i], dp[j] + 1)
    max_length = max(dp)
    result = []
    for i in reversed(range(n)):
        if dp[i] == max_length:
            result.append(nums[i])
            max_length -= 1
    return result[::-1]

